import { Box } from "@material-ui/system";
import { Typography } from "@material-ui/core";
import FieldResult from "./FieldResult.jsx";
export default function CardResult({margemBruta,margemOperacional,margemLiquida}){

    return(
        <Box sx={{height:"500px",width:"300px",backgroundColor:"#f4f4f4", borderRadius:"10px"}}>
            <Typography component="h2" variant="h4"> Resultados</Typography>
            <FieldResult title="Margem Bruta" value={margemBruta}/>
            <FieldResult title="Margem Operacional" value={margemOperacional}/>
            <FieldResult title="Margem Líquida" value={margemLiquida}/>

        </Box>
    )
}
